private boolean equalsTo(Feature other) {
  if (index != other.index) {
    return false;
  }
  if (name == null) {
    if (other.name != null) {
      return false;
    }
  } else if (!name.equals(other.name)) {
    return false;
  }
  if (params == null) {
    if (other.params != null) {
      return false;
    }
  } else if (!params.equals(other.params)) {
    return false;
  }
  return true;
}

